class Solution {

    /**
     * @param Integer[] $nums
     * @param Integer $k
     * @return Integer
     */
    function maxSum($nums, $k) {
        $mod = 1000000007;

        // Maximize the elements by always performing AND operation with itself which does not change the element
        // Since AND operation does not increase the value of an element, the original elements are already maximized
        // Therefore, we just need to select the k largest elements and calculate the sum of their squares

        // Sort the array in non-increasing order to get the k largest elements easily
        rsort($nums);

        // Calculate the sum of squares of the k largest elements
        $sum = 0;
        for ($i = 0; $i < $k; $i++) {
            $sum = ($sum + ((int)pow($nums[$i], 2) % $mod)) % $mod;
        }

        return $sum;
    }
}
